        firstName: "",
        lastName: "",
        email: "",
        street: "",
        city: "",
        state: "",
        zipcode: "",
        country: "",
        phone: ""
    });
  return (
    <div>
      testing MyOrder page
    </div>
  )
}

export default MyOrder
